style.css:
@-moz-document domain("docs.ros.org") {
body {
        background-color: #1e1e1e; /* Dark background color */
        color: #d4d4d4; /* Light text color */
        font-family: Consolas, 'Courier New', monospace; /* Monospace font */
    }

    /* Code blocks */
    pre, code {
        background-color: #2d2d2d; /* Slightly lighter background for code blocks */
        color: #d4d4d4; /* Light text color */
        padding: 10px;
        border-radius: 4px;
        overflow-x: auto;
    }

    /* Syntax highlighting */
    .token.comment,
    .token.block-comment,
    .token.prolog,
    .token.doctype,
    .token.cdata {
        color: #6a9955;
    }

    .token.punctuation {
        color: #d4d4d4;
    }

    .token.property,
    .token.tag,
    .token.boolean,
    .token.number,
    .token.constant,
    .token.symbol,
    .token.deleted {
        color: #b5cea8;
    }

    .token.selector,
    .token.attr-name,
    .token.string,
    .token.char,
    .token.builtin,
    .token.inserted {
        color: #ce9178;
    }

    .token.operator,
    .token.entity,
    .token.url,
    .token.variable {
        color: #d4d4d4;
    }

    .token.atrule,
    .token.attr-value,
    .token.keyword {
        color: #c586c0;
    }

    .token.function,
    .token.class-name {
        color: #dcdcaa;
    }

    .token.regex,
    .token.important {
        color: #d16969;
    }

    .token.important,
    .token.bold {
        font-weight: bold;
    }
    .token.italic {
        font-style: italic;
    }

    .token.entity {
        cursor: help;
    }

    .navbar {
        background-color: #333; /* Dark background for navbar */
        color: #d4d4d4; /* Light text color */
    }

    .navbar a {
        color: #d4d4d4; /* Light text color for links */
    }

    .navbar a:hover {
        color: #ffffff; /* White color for hovered links */
    }
}
